import React from 'react';
import { Box, Button, Typography, Container } from '@mui/material';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <Container maxWidth="sm" sx={{ paddingTop: 4 }}>
      <Box sx={{ textAlign: 'center' }}>
        <Typography variant="h3" gutterBottom>
          Welcome to Fitness Tracker
        </Typography>
        <Typography variant="h6" paragraph>
          Manage your fitness journey, track progress, and create personalized training plans. Whether you're a trainer or a trainee, this app will help you stay on track and achieve your fitness goals.
        </Typography>

        {/* Conditional rendering: If the user is logged in, show dashboard link */}
        <Box sx={{ marginTop: 2 }}>
          <Link to="/trainer/dashboard" style={{ textDecoration: 'none' }}>
            <Button variant="contained" color="primary">
              Go to Dashboard
            </Button>
          </Link>
        </Box>

        {/* If the user is not logged in, provide login link */}
        <Box sx={{ marginTop: 2 }}>
          <Link to="/login" style={{ textDecoration: 'none' }}>
            <Button variant="outlined" color="secondary">
              Login with Google
            </Button>
          </Link>
        </Box>
      </Box>
    </Container>
  );
};

export default Home;
